import React from "react";

function Categories() {
  return (
    <div className="container" style={{ marginLeft: 220 }}>
      <h1>Категории</h1>
      <ul>
        <li>Технологии</li>
        <li>Бизнес</li>
        <li>Спорт</li>
        <li>Наука</li>
      </ul>
    </div>
  );
}

export default Categories;
